import React from 'react'
import CV from "/public/imges/CV_RS.pdf"


const CTA = () => {
  return (
    <div className='cta'>
      <a href={CV} download className='btn'>Download CV</a>   
      <a href="#contact"  className='btn btn-primary'>Let`s Talk</a>
    </div>
  )
}

export default CTA
